import React from "react";
import Navigation from "./components/Navigation/Navigation";
import "./style/index.css";

// const btnCloseModal = document.querySelector(".btn-understand");
// const modal = document.querySelector(".modal");
// const overlay = document.querySelector(".overlay");

// console.log(showModal);
const openModal = function () {
  modal.classList.remove("hidden");
  overlay.classList.remove("hidden");
};

const closeModal = function () {
  modal.classList.add("hidden");
  overlay.classList.add("hidden");
};

btnCloseModal.addEventListener("click", closeModal);

function App() {
  return (
    <div>
      <Navigation />
      <div className="overlay"></div>

      <div className="modal warning">
        <h3>Warning!</h3>
        <p>
          The System is not perfect there's might be lag or worse crash your
          computer
          <br />
          we're not garantee your safety
        </p>
        <button className="btn-understand" onClick={openModal}>
          I Understand
        </button>
      </div>

      <div className="result">
        <div className="attackers-wrapper">
          <div className="attackers__label">
            <h2>Attackers</h2>
          </div>
          <div className="attackers">
            <div className="attackers__row">
              <div className="attackers__row--label">Player Name</div>
              <div className="attackers__row--label">Score</div>
            </div>
            <div className="attackers__row attackers__row--add">
              <div className="attackers__row--playerName">PlaceHolder</div>
              <div className="attackers__row--playerPoints">0</div>
            </div>
          </div>
        </div>
        <div className="defenders-wrapper">
          <div className="defenders__label">
            <h2>Defenders</h2>
          </div>
          <div className="defenders">
            <div className="defenders__row">
              <div className="defenders__row--label">Player Name</div>
              <div className="defenders__row--label">Score</div>
            </div>
            <div className="defenders__row defenders__row--add">
              <div className="defenders__row--playerName">PlaceHolder</div>
              <div className="defenders__row--playerPoints">0</div>
            </div>
          </div>
        </div>
        <footer className="dark-footer">
          <h3>MPL2.0 Lisence &copy;2021 Prawich & Jirat</h3>
          <ul>
            <a href="#">
              <li>Portals</li>
            </a>
            <a href="#">
              <li>GitHub</li>
            </a>
            <a href="#">
              <li>Documentation</li>
            </a>
            <a href="#">
              <li>System</li>
            </a>
          </ul>
        </footer>
      </div>
    </div>
  );
}

export default App;
